    <>
      {isLoading && <h3>Is loading...</h3>}
      <div>This is my app</div>
      <h3>These are my thoughts: {products}</h3>
      <CheckProps props={{ name: "Angela", age: 22 }} />
    </>
  );
};

ReactDom.render(<App />, document.getElementById("root"));
